import React, { useState } from 'react'

const Crismes = () => {

    const meyveler = ["Elma", "Armut", "Üzüm", "Portakal", "Kayısı"];
  
    const meyveleriListele = () => {
      let liste = [];
      for (let i = 0; i < meyveler.length; i++)
        liste.push(<li key={i}>{meyveler[i]}</li>);
      return liste;
    };
    return (
      <div>
        <h3>Meyveler</h3>
        <ul>{meyveleriListele()}</ul>
      </div>
    );
  }

export default Crismes
